import connectIco from './connect.svg';
import './App.css';
import { Modal, Input, Tooltip } from 'antd';
import { UserOutlined, QuestionOutlined, EyeInvisibleOutlined } from '@ant-design/icons';
import browser from 'browser-detect';
import { useState } from 'react';



function App() {
  const [token, changeToken] = useState('');
  const [showToken, toggleToken] = useState(false);
  return (
    <div className="App">
      <Modal
        title="只需一步"
        style={{ top: 20 }}
        visible={false}
        onOk={() => this.setModal1Visible(false)}
        onCancel={() => this.setModal1Visible(false)}
      >
        <p>请输入你想使用的用户名，这将作为你的<Tooltip title="这是区分你与其它用户的标识" arrowPointAtCenter><strong>连接标识</strong></Tooltip></p>
        <Input placeholder="用户名" prefix={<UserOutlined />} />
      </Modal>
      <header className="App-header">
        <img src={connectIco} className="App-logo" alt="logo" />
        <p className="token-title">
          你的 Token
          <Tooltip title="token是创建与服务器连接的凭据" arrowPointAtCenter>
            <QuestionOutlined style={{ fontSize: '10px', color: '#08c', verticalAlign: 'top' }} />
          </Tooltip>
          已创建：{showToken ? token : '**********'}
          <EyeInvisibleOutlined style={{ fontSize: '12px', color: '#08c', verticalAlign: 'top', paddingLeft: 5 }} />
        </p>
        <p className="os-name">操作系统：{browser().os}<a className="other-versions">其它版本</a></p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          开始使用
        </a>
      </header>
    </div>
  );
}

export default App;
